function b64ToArrayBuffer(b64en) {
    var bin = window.atob(b64en);
    var len = bin.length;
    var uInt8Array = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
      uInt8Array[i] = bin.charCodeAt(i);
    }
    return uInt8Array.buffer;
  }

document.addEventListener("adobe_dc_view_sdk.ready", function () {
    var adobeDCView = new AdobeDC.View({
        clientId: clientID,
        divId: "adobe-dc-view"
    });
    // PDF transformed in b64 string via a local script
    // below is a sample document
    var b64 = "";
    adobeDCView.previewFile({
        // convert the Base64 encoded PDF and convert it to an ArrayBuffer
        // and pass it as a Promise
        content: { promise: Promise.resolve(b64ToArrayBuffer(b64)) },
        // The filename name to display in the View SDK UI
        // and also used as the filename of the PDF when downloaded
        metaData: { 
                    fileName: "PDF EMBED API WINDOW TITLE.PDF",
                    id: "88c7bea9-67d9-4836-a561-5c006a057fbe" 
                      }
        }, 
        viewOptions
    )
});

